// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmLiveIndicator 
} from '@vime/core';

import { define } from '../lib';


define('vm-live-indicator', VmLiveIndicator);


export interface LiveIndicatorProps extends JSX.VmLiveIndicator, HTMLAttributes<HTMLVmLiveIndicatorElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmLiveIndicatorElement, LiveIndicatorProps>(
  'vm-live-indicator',
  new Set(['isLive','i18n']),
);
